import React from 'react'

const ProjectInfos = props => {

    const { technos, description, number } = props.project;

    return (

            <div className="infos-content">
                <h5>{number}</h5>
                <p>{technos}</p>
                <p>{description.fr}</p>
            </div>

    )
}

export default ProjectInfos;
